// StudentRegister.js
import React, { useState } from 'react';
import '../styles/Register.css';
import axios from 'axios';

const StudentRegister = () => {
  const [formData, setFormData] = useState({
    name: '',
    rollNumber: '',
    dob: '',
    registerNumber: '',
    branch: '',
    yearOfEntry: '',
    fatherName: '',
    fatherOccupation: '',
    educationOccupation: '',
    familyBackground: '',
    parentPhoneNo: '',
    address: '',
    languagesKnown: '',
    guardianName: '',
    lastSchoolName: '',
    mediumOfInstructions: '',
    marksInPlusTwo: {
      maths: '',
      physics: '',
      chemistry: '',
      cutOff: '',
      quota: ''
    },
    counselorNames: {
      firstYear: '',
      secondYear: '',
      thirdYear: '',
      finalYear: ''
    }
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await axios.post('http://localhost:5000/api/students/register', formData);
      console.log('Registration successful:', response.data);
      alert('Student registered successfully');
    } catch (err) {
      console.error('Error registering student:', err);
      alert('Error occurred while registering');
    }
  };

  return (
    <div className="container">
      <h2>Student Registration</h2>
      <form onSubmit={handleSubmit}>
        {/* Add input fields for the student registration form */}
        <input
          type="text"
          name="name"
          value={formData.name}
          onChange={handleChange}
          placeholder="Name"
          required
        />
        <input
          type="text"
          name="rollNumber"
          value={formData.rollNumber}
          onChange={handleChange}
          placeholder="Roll Number"
          required
        />
        <input
          type="date"
          name="dob"
          value={formData.dob}
          onChange={handleChange}
          required
        />
        <input
          type="text"
          name="registerNumber"
          value={formData.registerNumber}
          onChange={handleChange}
          placeholder="Register Number"
          required
        />
        <input
          type="text"
          name="branch"
          value={formData.branch}
          onChange={handleChange}
          placeholder="Branch"
          required
        />
        {/* Add more fields for all required student details */}
        <button type="submit">Register</button>
      </form>
    </div>
  );
};

export default StudentRegister;
